import React, { useState } from 'react';
import { Image, ImageBackground, SafeAreaView, ScrollView, StyleSheet, Text, TouchableOpacity, View } from 'react-native';
import { Calendar, Agenda } from 'react-native-calendars';

export default function ProfileScreen({ navigation }) {
  const [items, setItems] = useState({});

  const AddAgenda = () => {
    setTimeout(() => {
      const dates = {
        '2023-12-01': [{ text: 'Test for CS' }],
        '2023-12-02': [{ text: 'Test for Engineering' }],
        '2023-12-03': [{ text: 'Review Flashcard 2' }]
      };

      const newItems = { ...items, ...dates };

      setItems(newItems);
    }, 200);
  };

  const AgendaContent = (item) => {
    return (
      <Text style={styles.AgendaItems}>{item.text}</Text>
    );
  };

  return (
    <ImageBackground source={require('../assets/JungleBg.gif')} style={styles.ProfileContainer}>
      <SafeAreaView style={{ flex: 1, paddingBottom: 100 }}>
        <ScrollView>
          <View style={styles.c1}>
            {/* Your existing profile content */}
          </View>

          <Text style={[styles.l1]}> Calendar </Text>
          <View style={styles.calendarContainer}>
            <Agenda
              items={items}
              selected='2023-12-01'
              renderItem={AgendaContent}
              loadItemsForMonth={AddAgenda}
            />
          </View>

          <Text style={[styles.l1]}> About Grove Cards: </Text>
          <View style={[styles.c2]}>
            <Text>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.
            </Text>
          </View>
        </ScrollView>
      </SafeAreaView>
    </ImageBackground>
  );
}

const styles = StyleSheet.create({
    //profilecontainer
    ProfileContainer:{
        flex:1,
        backgroundColor:'#fff'
    },
    c1:{
      flexDirection: 'row',
      alignItems: 'center',
      paddingHorizontal: 16,
      marginTop: 30,
      height: 'auto'
    },
    profileImage: {
        width: 80,
        height: 80,
        left: 20,
        borderRadius: 100,
        overflow: 'hidden',
        borderWidth: 3,
        borderColor: '#3A4D39',
        position: 'absolute',
        zIndex: 1,
    },
    logo:{
      width: 80,
      height: 80,
      left: 60,
    },
    image: {
        flex: 1,
        width: undefined,
        height: undefined,
        aspectRatio:1,
    },
    profileInfo:{
        alignItems:'center',
        marginTop:20,
        marginBottom: 20,
        marginLeft: 80,
    },
    usernamebg:{
      backgroundColor: "rgba(236, 227, 206, 0.8)",
      borderRadius: 10,
      height: 40,
      width: 150,
      alignItems: 'center',
      justifyContent: 'center',
      marginBottom: 5
    },
    Username: {
      color: '#3A4D39',
      fontWeight: 'bold',
      fontSize: 14,
      fontFamily: 'monospace',
    },
    course: {
      fontSize: 10,
      color: '#ECE3CE',
      fontWeight: 'bold',
      fontFamily: 'monospace',
    },
    uni:{
      fontSize: 10,
      color: '#ECE3CE',
      fontWeight: 'bold',
      fontFamily: 'monospace',
    },
    l1 :{
      fontSize: 24,
      fontWeight: 'bold',
      color: '#ECE3CE',
      marginLeft: 15,
      marginBottom: 5,
      marginTop: 30,
      fontFamily: 'monospace',
      textShadowColor: 'rgba(0, 0, 0, 0.75)',
      textShadowOffset: {width: -1, height: 1},
      textShadowRadius: 10
    },
    AgendaItems:{
      color: "#3A4D39",
      marginVertical: 40,
      fontSize: 21,
      lineHeight: 26,
      fontFamily: 'monospace',
    },
    calendarContainer: {
      flex:1,
      margin: 16,
      backgroundColor: 'white',
      borderRadius: 15,
      padding: 15,
      width: 'auto',
      height: 'auto'
    },

    logoutbtn: {
      backgroundColor: '#ece3ce',
      padding: 5,
      borderRadius: 20,
      marginTop: 10,
      width: 150,
      alignItems: 'center',
      shadowOffset: {
        width: 0,
        height: 4
        },
      shadowRadius: 4,
      elevation: 4,
      shadowOpacity: 1,
    },

    c2: {
      backgroundColor: "rgba(236, 227, 206, 0.7)",
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      marginTop: 10,
      padding: 20,
      position: 'relative',
      borderRadius: 20,
      width: '100%'
    },


})
